import React from "react"
import "./navbar_banner.css"
import Display from "./navbar_banner_data"
import left from "./Images/left.png"
import right from "./Images/right.png"
import { Link } from "react-router-dom"
import Rating from "./Images/rating.jpg"

export default function Banner(){

const data = Display.map(data=>{

    return(
        <BannerData
        name= {data.name}
        img= {data.img}
        description = {data.description}
         />
    )
})


 let i=0

 const [productDisplay,setProductDisplay] = React.useState(data[i],)

//On Click Function
 function Left(){
        if(i==0){
            return(
                setProductDisplay(data[i])
            )
        }
        else{
            setProductDisplay(data[i=i-1])
        }
 }
 function Right(){
    if(i==Display.length-1){
        return(
            setProductDisplay(data[i])
        )
    }
    else{
        setProductDisplay(data[i=i+1])
    }
 }
//  Product-Description
function productDescription(){
    return(
        <div>

            <div id="product-top">
                <div id="product-desc">
                    <h1>Minimalist Sunscream (50 SPF)</h1>
                    <a><strong>Rs 249/-</strong></a>
                    <p>A light weight, moisturiser-meets-sunscreen. This broad spectrum SPF 50 with PA++++ rating, 
                       has a very light texture that spreads easily & disappears leaving behind a natural, moisturised,
                       non-shiny look. Loaded with Vitamins A, B, E & F that help repair skin and minimise damage caused 
                        by UV exposure.</p>
                    <img src={Rating} />
                    <button>Add to cart</button> 
                </div>


                <div id="product-image">
                    <img src={Image} />
                    <div id="more-images">
                        <div className="more-images"></div>
                        <div className="more-images"></div>
                    </div>
                </div>
        </div>
        </div>

    )
}


function BannerData(props){
    if(i==0){
        return(
            <div id="banner">
            <div className="end"></div>

               <div id="banner-text">
               <Link to="/products" ><a onClick={productDescription}>{props.name}</a></Link>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img">
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>   

            </div>
        )

    }
    else if(i==Display.length-1){
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <Link to="/products" ><a onClick={productDescription}>{props.name}</a></Link>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img">
                    <img src={props.img} />
                </div> 

              <div className="end"></div>     
            </div>
        )
    }
    else{
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <Link to="/products"><a onClick={productDescription}>{props.name}</a></Link>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img">
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>

            </div>
        )
    }

}

   return(
    <div>
         {productDisplay}
         {i}
    </div>
   )
}
